message:
cristianos ¿votar o no ?...
alguien dijo; para qué votar ,si siempre salen los mismos ,"todo está arreglado"...Martin Luther King Jr dijo;
"Nuestras vidas empiezan a terminar el día que guardamos silencio sobre las cosas que importan"..."La verdadera tragedia de los pueblos no es el grito de un gobierno autoritario ,si no el silencio de la gente"..."No me duelen los actos de la gente mala,me duele la indiferencia de la gente buena"...Edmund Burke (político y escritor Irlandés) dijo;"Para que triunfe el mal,sólo es necesario que los buenos no hagan nada "....en consecuencia ,si no votamos le damos el poder a los malos de siempre, Einstein Dijo; "Si buscas resultados distintos,no hagas siempre lo mismo"...si acostumbras a no votar pero criticas todo ,cambia,deja de criticar y ve a votar..!!!
